import React from 'react';
import Swiper from 'react-id-swiper';
const Navigation = () => {
    const params = {
        navigation: {
            nextEl: '.swiper-button-next',
            prevEl: '.swiper-button-prev'
        }
    }
    return (
        <Swiper {...params}>
            <div style={{height:"100vh",width:"100vw"}}>Slide #1</div>
            <div style={{height:"100vh",width:"100vw"}}>Slide #2</div>
            <div style={{height:"100vh",width:"100vw"}}>Slide #3</div>
            <div style={{height:"100vh",width:"100vw"}}>Slide #4</div>
            <div style={{height:"100vh",width:"100vw"}}>Slide #5</div>
        </Swiper>
    )
};
export default Navigation;
